import React from "react";
import "./navbar.scss";

function Navbar() {
    return (
        <div class="Container">
            <div class="box">
                <div class="title">
                    <span class="block"></span>
                    <h1>Dictionary4You<span></span></h1>
                </div>
                <div class="role">
                    <div class="block"></div>
                        <p>Learn-Sleep-Repeat</p>
                </div>
            </div>
        </div>
    );
}
export default Navbar;
